export function Cart(propss) {
    console.log(propss);




    return <div className="col-md-6">
        <h3>Cart</h3>
        propss.dataa.map(elm => (
            <div className="col-md-3" key={elm.id}>
                <p>{elm.title}</p>
                <img src={elm.image} />



                <button onClick={() => propss.oncountUp(elm.id)} countUp></button>




                <table className="table table-dark table-bordered">
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Category</th>
                            <th>Price</th>
                            <th>Count</th>
                            <th>Subtotal</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            propss.dataa.map(Element => {
                                return <tr key={Element.id}>
                                    <td>{Element.title}</td>
                                    <td>{Element.category}</td>
                                    <td>{Element.price}</td>
                                    <td>{Element.count}</td>
                                    <td>{Element.count * Element.price}   </td>
                                </tr>
                            })
                        }
                    </tbody>
                </table>




            </div>

        ))}
    </div>

}
